import React from 'react';


function Dropdown(props) {
  let options = props.options

  return (
    <>
      <label>
        {props.label}
        <select value={props.value} onChange={props.change}>
        {options.map((option) => (
          <option value={option.time}>{option.id}</option>
        ))}
      </select>
    </label>

    </>
  )
}

export default Dropdown;
